Description:
            Felt pom-poms are like craft candy! These small handmade wool felt balls measure approximately 3/8 inch or 1cm wide and come in 50, 100 or 200 packs (the 200 poms are 10% off!). Select your favorite color(s) from our pom swatch chart and leave a note in the "message to seller" box during checkout. If no colors are selected, a multicolored bundle will be packaged. 
{ About Benzie's Pom-poms }
Our hand-formed pom-poms (also known as felt beads or felt balls) are approximate in size and can vary in diameter and by dye. Handmade in Nepal. Benzie also offers smaller quantities and various sizes in 1cm, 1.5cm, 2cm and 3cm sizes. Check out our other poms: 
https://www.etsy.com/shop/BenzieDesign?section_id=16843111.

{ About Benzie on Etsy }
Please note that our wool felt colors are different from our felt pom colors. For shipping information and general questions visit our policies page: 
